import React, {Component} from 'react';
import {useSpring, animated} from 'react-spring'
import './MangaPanel.css';


class MangaPanel extends Component {
  constructor(props) {
    super(props);
  }

  getFadeInAnimation() {
    return useSpring({opacity: 1, from: {opacity: 0}});
  }

  render() {
    console.log("child component rendering");
    
    return (
      <animated.div style={this.getFadeInAnimation} key={this.props.pageConfig} className="MangaPanel">
        <img src={this.props.pageConfig.img} draggable="false" unselectable="on"></img>
      </animated.div>
    )
  }
}


export default MangaPanel;
